  return (
    <div className="App">
      <header className="App-header">
        <h1>React Weather App</h1>
        {/* <Icons/> */}
      </header>
      <main>
        <Forecast />
      </main>
      <footer>
        Page created by Elham
      </footer>
    </div>
  );
}

export default App;
